TITLE:
  - Krylov-Space-Projection test case 12x12x12 elements
  - 'shear flow in (x,y,z)=(1,1,1) direction'
  - 'an initial field is set with constant pressure of 4 on a cube [0,1]^3, avg-pres = 4'
  - 'a bodyforce leads to a linear pressure solution, the initial avg-pres is retained'
  - DirectDivergence integration rule leads to an exact solution
  - 'Tesselation approach failes due to discarded integration cells, set VOLUME-tol to 1e-18'
PROBLEM TYPE:
  PROBLEMTYPE: "Fluid_XFEM"
FLUID DYNAMIC:
  LINEAR_SOLVER: 1
  TIMEINTEGR: "Stationary"
  NONLINITER: Newton
  INITIALFIELD: "field_by_function"
  ADAPTCONV: true
  RESTARTEVERY: 0
  STARTFUNCNO: 2
  TIMESTEP: 1
  MAXTIME: 1
  THETA: 1
FLUID DYNAMIC/NONLINEAR SOLVER TOLERANCES:
  TOL_VEL_RES: 1e-12
  TOL_VEL_INC: 1e-12
  TOL_PRES_RES: 1e-12
  TOL_PRES_INC: 1e-12
FLUID DYNAMIC/RESIDUAL-BASED STABILIZATION:
  STABTYPE: "edge_based"
  PSPG: false
  SUPG: false
  GRAD_DIV: false
  DEFINITION_TAU: "Taylor_Hughes_Zarins_Whiting_Jansen_wo_dt"
FLUID DYNAMIC/EDGE-BASED STABILIZATION:
  EOS_PRES: "std_eos"
  EOS_CONV_STREAM: "std_eos"
  EOS_DIV: "vel_jump_std_eos"
  EOS_DEFINITION_TAU: "Burman_Fernandez"
  EOS_H_DEFINITION: EOS_he_max_dist_to_opp_surf
XFEM GENERAL:
  VOLUME_GAUSS_POINTS_BY: "DirectDivergence"
XFLUID DYNAMIC/STABILIZATION:
  NIT_STAB_FAC: 21.97015825
  VISC_STAB_HK: "vol_equivalent"
  CONV_STAB_SCALING: "abs_inflow"
  GHOST_PENALTY_STAB: true
  GHOST_PENALTY_FAC: 0.01
SOLVER 1:
  SOLVER: "Belos"
  AZOUTPUT: 50
  NAME: "Fluid_Solver"
MATERIALS:
  - MAT: 1
    MAT_fluid:
      DYNVISCOSITY: 1
      DENSITY: 1
      GAMMA: 1
  - MAT: 2
    MAT_Struct_StVenantKirchhoff:
      YOUNG: 1e+11
      NUE: 0
      DENS: 0
FUNCT1:
  - COMPONENT: 0
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "1.0"
  - COMPONENT: 1
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "1.0"
  - COMPONENT: 2
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "1.0"
  - COMPONENT: 3
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "0.0"
FUNCT2:
  - COMPONENT: 0
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "0.0"
  - COMPONENT: 1
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "0.0"
  - COMPONENT: 2
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "0.0"
  - COMPONENT: 3
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "4.0"
DESIGN VOL NEUMANN CONDITIONS:
  - E: 1
    NUMDOF: 6
    ONOFF: [1, 1, 1, 0, 0, 0]
    VAL: [1, 1, 1, 0, 0, 0]
    FUNCT: [1, 1, 1, 0, 0, 0]
